import { useState } from "react";
import { useNavigate } from "react-router-dom";
import { IMaskInput } from "react-imask";
import Navbar from "../components/Navbar";

function Register() {
    const navigate = useNavigate();

    const [formData, setFormData] = useState({
        rut: "",
        nombre: "",
        apellido: "",
        correo: "",
        telefono: "",
        contrasena: "",
    });

    const [confirmPassword, setConfirmPassword] = useState("");
    const [error, setError] = useState("");

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData((prevState) => ({
            ...prevState,
            [name]: value,
        }));
    };

    const handleRutChange = (formattedInput) => {
        setFormData((prevState) => ({
            ...prevState,
            rut: formattedInput,
        }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        if (formData.contrasena !== confirmPassword) {
            setError("Las contraseñas no coinciden.");
            return;
        }

        try {
            const response = await fetch(
                "http://localhost:5000/api/userManagement/register",
                {
                    method: "POST",
                    headers: {
                        "Content-Type": "application/json",
                    },
                    body: JSON.stringify(formData),
                }
            );

            const result = await response.json();

            if (!response.ok) {
                throw new Error(
                    result.error || "Ocurrió un error desconocido."
                );
            }

            console.log("Respuesta del servidor:", result);
            alert(`¡Registro exitoso ${formData.nombre}! Serás redirigido.`);
            navigate("/");
        } catch (error) {
            setError(error.message);
        }
    };

    return (
        <div>
            <Navbar />
            <form onSubmit={handleSubmit}>
                <h2>Formulario de Registro</h2>
                <div>
                    <label htmlFor="rut">Rut:</label>
                    <IMaskInput
                        // 1. Define las DOS máscaras posibles
                        mask={[
                            {
                                mask: "0.000.000-L",
                                lazy: false, // Importante: Rellena desde la derecha
                            },
                            {
                                mask: "00.000.000-L",
                                lazy: false, // Importante: Rellena desde la derecha
                            },
                        ]}
                        // 2. Define la 'L' como el dígito verificador
                        definitions={{
                            L: {
                                mask: /^[0-9kK]{1}$/,
                                transform: (char) => char.toUpperCase(),
                            },
                        }}
                        dispatch={(appended, dynamicMasked) => {
                        // Obtiene el valor limpio (solo números y K)
                        const clean = dynamicMasked.unmaskedValue;

                        // Si el valor limpio tiene 8 caracteres o menos (7 dígitos + K),
                        // usa la primera máscara (0.000.000-L)
                        if (clean.length <= 8) {
                            return dynamicMasked.compiledMasks[0];
                        }

                        // Si tiene más, usa la segunda máscara (00.000.000-L)
                        return dynamicMasked.compiledMasks[1];
                    }}
                        id="rut"
                        name="rut"
                        placeholder="12.345.678-9"
                        required
                        value={formData.rut}
                        onAccept={(value) => handleRutChange(value)}
                    />
                </div>
                <div>
                    <label htmlFor="nombre">Nombre:</label>
                    <input
                        type="text"
                        id="nombre"
                        name="nombre"
                        value={formData.nombre}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label htmlFor="apellido">Apellido:</label>
                    <input
                        type="text"
                        id="apellido"
                        name="apellido"
                        value={formData.apellido}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label htmlFor="correo">Correo Electrónico:</label>
                    <input
                        type="email"
                        id="correo"
                        name="correo"
                        value={formData.correo}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label htmlFor="telefono">Número de teléfono:</label>
                    <input
                        type="text"
                        id="telefono"
                        name="telefono"
                        value={formData.telefono}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label htmlFor="contrasena">Contraseña:</label>
                    <input
                        type="password"
                        id="contrasena"
                        name="contrasena"
                        value={formData.contrasena}
                        onChange={handleChange}
                        required
                    />
                </div>
                <div>
                    <label htmlFor="contrasena">Repetir contraseña:</label>
                    <input
                        type="password"
                        id="confirmarContrasena"
                        name="confirmarContrasena"
                        value={confirmPassword}
                        onChange={(e) => setConfirmPassword(e.target.value)}
                        required
                    />
                </div>

                {error && <p style={{ color: "red" }}>{error}</p>}

                <button type="submit">Registrarse</button>
            </form>
        </div>
    );
}

export default Register;
